INSERT INTO `qrcodedb` (`id`, `title`, `major`, `content`, `image`, `videos`, `address`) VALUES (1, 'first', 'doinginging', '![image](https://uicdn.toast.com/toastui/img/tui-editor-bi.png)\n\n# Awesome Editor!\n\nIt has been _released as opensource in 2018_ and has ~~continually~~ evolved to **receive 10k GitHub ⭐️ Stars**.\n\n## Create Instance\n\nYou can create an instance with the following code and use `getHtml()` and `getMarkdown()` of the [Editor](https://github.com/nhn/tui.editor).\n\n```js\nconst editor = new Editor(options);\n```\n\n> See the table below for default options\n> > More API information can be found in the document\n\n| name | type | description |\n| --- | --- | --- |\n| el | `HTMLElement` | container element |\n\n## Features\n\n* CommonMark + GFM Specifications\n   * Live Preview\n   * Scroll Sync\n   * Auto Indent\n   * Syntax Highlight\n        1. Markdown\n        2. Preview\n\n## Support Wrappers\n\n> * Wrappers\n>    1. [x] React\n>    2. [x] Vue\n>    3. [ ] Ember![my honey](data:image/jpeg;base64,)', 'https://images.pexels.com/photos/7417656/pexels-photo-7417656.png?auto=compress&cs=tinysrgb&dpr=1&w=150', 'https://images.pexels.com/photos/7417656/pexels-photo-7417656.png?auto=compress&cs=tinysrgb&dpr=1&w=150', 'https://img-blog.csdnimg.cn/20200930114343993.PNG?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3MxbmdsZQ==,size_16,color_FFFFFF,t_70');
INSERT INTO `qrcodedb` (`id`, `title`, `major`, `content`, `image`, `videos`, `address`) VALUES (2, 'second', 'finish', '在Spring4.x版本中推荐的注入方式就是这种，相较于上面的field注入方式而言，就显得有点难看，特别是当注入的依赖很多（5个以上）的时候，就会明显的发现代码显得很臃肿。对于从field注入转过来+有强迫症的园友 来说，简直可以说是石乐志  (`Д´*)9。对于这一点我们后面再来讨论，别急', 'https://images.pexels.com/photos/4675531/pexels-photo-4675531.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=150', 'https://img-blog.csdnimg.cn/20200930114343993.PNG?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3MxbmdsZQ==,size_16,color_FFFFFF,t_70', 'blob:chrome-extension://nnnkddnnlpamobajfibfdgfnbcnkgngh/08e929cd-57a5-422d-96e0-5b33057b3f01');
INSERT INTO `qrcodedb` (`id`, `title`, `major`, `content`, `image`, `videos`, `address`) VALUES (3, 'third', 'test', '这几个信息哈，然后到时候让他们提供一下腾讯打款的金额是多少吗，我们填写正确了才能完成验证', 'https://images.pexels.com/photos/990349/pexels-photo-990349.jpeg?auto=compress&cs=tinysrgb&dpr=2&w=150', 'http://file06.16sucai.com/2016/0806/fe48f9d41b21a269ba9446c11308a0ec.jpg', 'http://file06.16sucai.com/2016/0806/fe48f9d41b21a269ba9446c11308a0ec.jpg');
INSERT INTO `qrcodedb` (`id`, `title`, `major`, `content`, `image`, `videos`, `address`) VALUES (4, 'fouth', 'english', 'Here are some english words of my own project,you can see these words in a tooltip.', 'https://images.pexels.com/photos/7417656/pexels-photo-7417656.png?auto=compress&cs=tinysrgb&dpr=1&w=150', 'blob:chrome-extension://nnnkddnnlpamobajfibfdgfnbcnkgngh/08e929cd-57a5-422d-96e0-5b33057b3f01', 'blob:chrome-extension://nnnkddnnlpamobajfibfdgfnbcnkgngh/08e929cd-57a5-422d-96e0-5b33057b3f01');
INSERT INTO `qrcodedb` (`id`, `title`, `major`, `content`, `image`, `videos`, `address`) VALUES (5, 'five', 'longtexttest', '![image](https://uicdn.toast.com/toastui/img/tui-editor-bi.png)\r\n\r\n# Awesome Editor!\r\n\r\nIt has been _released as opensource in 2018_ and has ~~continually~~ evolved to **receive 10k GitHub ⭐️ Stars**.\r\n\r\n## Create Instance\r\n\r\nYou can create an instance with the following code and use `getHtml()` and `getMarkdown()` of the [Editor](https://github.com/nhn/tui.editor).\r\n\r\n```js\r\nconst editor = new Editor(options);\r\n```\r\n\r\n> See the table below for default options\r\n> > More API information can be found in the document\r\n\r\n| name | type | description |\r\n| --- | --- | --- |\r\n| el | `HTMLElement` | container element |\r\n\r\n## Features\r\n\r\n* CommonMark + GFM Specifications\r\n   * Live Preview\r\n   * Scroll Sync\r\n   * Auto Indent\r\n   * Syntax Highlight\r\n        1. Markdown\r\n        2. Preview\r\n\r\n## Support Wrappers\r\n\r\n> * Wrappers\r\n>    1. [x] React\r\n>    2. [x] Vue\r\n>    3. [ ] Ember![my honey](data:image/jpeg;base64,)', 'https://images.pexels.com/photos/7417656/pexels-photo-7417656.png?auto=compress&cs=tinysrgb&dpr=1&w=150', 'blob:chrome-extension://nnnkddnnlpamobajfibfdgfnbcnkgngh/08e929cd-57a5-422d-96e0-5b33057b3f01', 'blob:chrome-extension://nnnkddnnlpamobajfibfdgfnbcnkgngh/08e929cd-57a5-422d-96e0-5b33057b3f01');
